import "./Contact.css";

function Contact() {
  return (
    <div className="contact">
      <h1>Contact</h1>
      <ol>
        <li>
          <strong>Phone Nimber:</strong> (XXX-XXX-XXXX)
        </li>
        <li>
          <strong>Email:</strong> Yoel@gmail.com
        </li>
        <li>
          <strong>Adress:</strong> California
        </li>
      </ol>
    </div>
  );
}

export default Contact;
